import React, { useState, useEffect } from "react";

function EnrollDecide(props) {
  return (
    <div>
      {props.enrollment.map((enroll) => {
        if (enroll.status == "pending") {
            const userId = props.user.find(usr => usr.id === enroll.userId);

          return (
            <div >
                <p>{userId}</p>
              <p>{enroll.status}</p>
              <p>{enroll.id}</p>
              <p>{enroll.trialId}</p>
            </div>
          );
        }
      })}
    </div>
  );
}

export default EnrollDecide;
